import aloe from "../assets/images/aloevera.webp";
import snake from "../assets/images/snakeplant.webp";
const plants = [
  {
    id: 1,
    name: "Aloe Vera",
    price: 250,
    image: aloe,
    description: "Easy to care medicinal plant"
  },
  {
    id: 2,
    name: "Snake Plant",
    price: 400,
    image: snake,
    description: "Air purifying indoor plant"
  }
];

export default plants;
